(6, 'STRETCHING CANVAS PAINTINGS', 'stretching-canvas-paintings', '2', 'Have an existing canvas print or painting that you want to have stretched? Off The Wall Framing provides experienced professional stretching services. We take your existing canvas and stretch it over the highest quality pine stretcher bar frame to transform your rolled canvas into a ready-to-hang artwork. ', 'uploads/featured_image/86501banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_761_banner 910x250.jpg', NULL, '', '', 'Canvas Stretching', 'active', 0, 0, '2016-03-12 19:49:21', '2017-10-05 05:12:44', NULL, 0),
(7, 'CUSTOM PHOTO FRAMING', 'custom-photo-framing', '2', 'Customise your framing using our online tools or contact us and we will guide you through the process of selecting mouldings and mat borders using our experience and professional knowledge. We have spent over 30 years carefully curating our range of quality Australian and International mouldings so you can be assured to find the right frame to suit your style and compliment your photo or artwork. ', 'uploads/featured_image/20806custom_framing_web.jpg', NULL, 'uploads/featured_image/thumb_200x200_430_custom_framing_web.jpg', NULL, 'Customised Picture Framing to Any Size - Large, Square, Long', '', 'Custom Framing App', 'active', 0, 0, '2016-03-12 19:49:48', '2017-09-23 12:54:53', NULL, 1),
(8, 'COLLAGE FRAMING', 'collage-framing', '2', '', 'uploads/featured_image/47596banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_195_banner 910x250.jpg', NULL, 'Collage Framing | Multiple Picture Framing | Off The Wall Framing Sydney', '', '', 'active', 0, 0, '2016-03-12 19:50:07', '2017-03-17 14:40:28', NULL, 0),
