(16, 'MEMORABILIA FRAMING', 'memorabilia-framing', '2', 'Specialists in framing all kinds of memorabilia including football jerseys, medals and all souvenirs. ', 'uploads/featured_image/13596memorabilia_collage.jpg', NULL, 'uploads/featured_image/thumb_200x200_746_memorabilia_collage.jpg', NULL, 'Memorabilia Framing | Jersey, Bat, Baseball, Cap, Coins, Medals', '', 'Specialists in framing all kinds of memorabilia including football jerseys, medals and all souvenirs. ', 'active', 0, 0, '2016-03-12 19:52:53', '2017-09-19 17:29:02', NULL, 0),
