(23, 'CUSTOM CANVAS PRINT', 'custom-canvas-print', '1', '', 'uploads/featured_image/17968CUSTOM CANVAS PRINTS.jpg', NULL, 'uploads/featured_image/thumb_200x200_731_CUSTOM CANVAS PRINTS.jpg', NULL, '', '', '', 'active', 0, 0, '2016-03-12 19:55:44', '2017-09-15 14:29:53', NULL, 0),
(24, 'MODERN ART', 'modern-art', '1', '<p>Off The Wall Framing has a vast collection of modern artworks to suit a range of tastes. Below is a range of modern hand-painted abstracts we regularly stock however, we sell an ever-changing range of paintings in a variety of sizes and styles.</p>\r\n\r\n<p>We also have a custom artwork service where one of our talented artists will paint an artwork to your specifications, should you not find something suitable from our huge range. </p>\r\n\r\n<p>We are happy to share professional guidance to help you with your selection and can also assist with delivery and installation. </p>\r\n\r\n<p>E: offthewall.frames@hotmail.com   |  P: 02 9567 2422  |  425 Princes Highway, ROCKDALE NSW 2216</p>\r\n\r\n', 'uploads/featured_image/64249painting_web.jpg', NULL, 'uploads/featured_image/thumb_200x200_661_painting_web.jpg', NULL, 'Modern Art', '', '', 'active', 0, 0, '2016-03-12 19:56:00', '2017-10-07 23:29:45', NULL, 0),
(26, 'OFF THE WALL', 'off-the-wall', '3', '<p>Off The Wall Framing have been Australia''s leading custom picture framing and photo framing company since 1987. We are a Australian-owned and operated business based in Sydney NSW, and only serve customers located in Australia.</p>\r\n<p>\r\nOff The Wall Framing started as a retail chain store manufacturing and selling custom framed pictures, canvas printing, various range of mirrors, artwork framing and stretching, in Sydney. We have served more than 29 years and over 1,00,000 satisfied customers later, we now provide an ever growing range of online picture framing, mirrors, artwork and printing services to companies and individuals alike. Our framing studio is the oldest and most trusted custom framing company in Sydney. We have framed many original artworks, canvases, football jerseys, and wonderful objects over the years. All the framing materials we use are of the best quality and acid-free materials. </p>', 'uploads/featured_image/93202banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_281_banner 910x250.jpg', NULL, 'Framing Pictures, Mirrors, Paintings & Memorabilia Since 1987', '', '', 'active', 0, 0, '2016-03-13 20:05:59', '2016-09-24 00:08:10', 0, 0),
(29, 'Classical Swing', 'classical-swing', '1', 'Classical art painting of a girl and a boy in romantic premise. this classical art can enhance the classical look of any place its displayed. We do any customized sizes as per your requirement.', 'uploads/featured_image/61049classical-swing.png', NULL, 'uploads/featured_image/thumb_200x200_791_classical-swing.png', NULL, '', '', '', 'active', 0, 0, '2016-03-14 18:28:12', '2016-03-14 11:40:23', 25, 0),
(36, 'About us', 'picture-framer', '3', '<p>Off The Wall Framing have been Australia''s leading custom picture framing and photo framing company since 1987. We are a Australian-owned and operated business based in Sydney NSW, and only serve customers located in Australia.</p>\r\n<p>Off The Wall Framing started as a retail chain store manufacturing and selling custom framed pictures, canvas printing, various range of mirrors, artwork framing and stretching, in Sydney. We have served more than 29 years and over 1,00,000 satisfied customers later, we now provide an ever growing range of online picture framing, mirrors, artwork and printing services to companies and individuals alike. Our framing studio is the oldest and most trusted custom framing company in Sydney. We have framed many original artworks, canvases, football jerseys, and wonderful objects over the years. All the framing materials we use are of the best quality and acid-free materials. </p>\r\n<p>Whether we''re dealing with precious family photos or large corporate orders we are professional with our work and we make an honest effort to handle it all in professional and delicate manner.</p>\r\n<p>As our customer, we strive to do our absolute best to value with the online convenience of choosing from a large range of unique and stylish products at competitive prices to beautify your spaces of creativity, work, and relaxation. We believe in personalised service, quality and integrity at realistic prices. </p>\r\n<p>We also specialise in Commercial Projects and we offer complete turnkey solutions for Apartments, Homes, Hotels Nationally.  We can supply complete packages or individual pieces and offer a complete consultation and design service.   </p>\r\n<p>We have an wide range of frame mouldings and matboard to choose from. Most standard frames can be ordered on this site, but if you have something special, or require a frame with multiple matboard windows, or you would like to place a large order and receive our bulk rate discount, please get in touch with us directly at our Showroom.</p>\r\n<p>The most efficient way to place your order is by visiting our Showroom located at 425 Princess Highway, Rockdale, NSW to see an item prior to purchase then our floor stock collections might just catch your eye. </p>\r\n<p> Thank you for visiting our site. </br>\r\nOFF THE WALL FRAMING PTY LTD</br>\r\nABN 77080200166</p>', 'uploads/featured_image/24985banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_208_banner 910x250.jpg', NULL, 'Picture Framer Rockdale | Off The Wall Framing', '', '', 'active', 0, 0, '2016-04-01 09:26:46', '2017-03-12 08:00:00', 0, 0),
(38, 'Terms And Conditions', 'terms-and-conditions', '3', '<ul>\r\n	<li>Offthewallframing.com.au puts significant effort into making sure the website information and prices are accurate & correct.</li>\r\n<li>Offthewallframing reserves the right to alter any information or price at any time. When incorrect information is identified Offthewallframing.com.au will update it as soon as possible.</li>\r\n<li>In the event that an order has been placed for a product that has an incorrect price or product description the customer will be offered a full refund or the customer can opt to pay the corrected price.</li>\r\n<li>Offthewallframing.com.au puts significant effort into making sure that all stock shown on the website are available. But Offthewallframing.com.au does not guarantee that some products will be available at the time of ordering.</li>\r\n<li>You must not use the Offthewallframing.com.au website in any way that is illegal under Australian law or in any way that may cause harm to Offthewallframing.com.au or it''s users.</li>\r\n<li>Offthewallframing reserves the right to block access to the website where inappropriate behave has been detected.</li>\r\n<li>You must not collect or redistribute the information or images available on the Offthewallframing.com.au website, either by data-mining or other methods.</li>\r\n<li>You must not upload, email or otherwise transmit any materials including but not limited to text, data, sketches, photos, drawings, graphics, digital images, and related visual compositions or any of these elements in combination as a design for products available on this site or otherwise contents that are unlawful, harmful, threatening, abusive, vulgar, harassing, defamatory, obscene, pornographic, indecent, inflammatory, libellous, tortuous, hateful, or racially, ethnically or otherwise objectionable, or invasive of another''s rights including but not limited to rights of celebrity, privacy and intellectual property.</li>\r\n<li>You must not impersonate any person or entity or falsely state or otherwise misrepresent your affiliation with a person or entity.</li>\r\n<li>You must not upload, email or otherwise transmit any content that may infringe any patent, trademark, trade secret, copyright or other intellectual or proprietary right of any party. By uploading or transmitting any content, you represent and warrant that you have the lawful right to reproduce and distribute such content and that the content complies with all applicable federal, state and local laws, regulations and ordinances.</li>\r\n<li>You must not upload, email or otherwise transmit any content that would constitute or encourage a criminal offense, violate the rights of any party, or that would otherwise create liability or violate any local, state, national, or international law.</li>\r\n<li>You must not upload, email or otherwise transmit any unsolicited or unauthorized advertising, promotional materials, junk mail, spam, chain letters, or any other form of solicitation.</li>\r\n<li>You must not upload, email or otherwise transmit any material that contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any computer software or hardware or telecommunications equipment.</li>\r\n<li>You must not upload, email or otherwise transmit false or misleading information.</li>\r\n<li>You must not disrupt or interfere with the security of, or otherwise abuse, this website, or any services, system resources, accounts, servers, or networks connected to or accessible through this website or affiliated or linked websites.</li>\r\n<li>You must not access, tamper with or use non-public areas of the Site. Unauthorized individuals attempting to access these areas of the website may be subject to prosecution.</li>\r\n<li>You must not disrupt or interfere with any other user''s enjoyment of this website or affiliated or linked websites.</li>\r\n<li>Upon uploading contents, You must acknowledge that Offthewallframing may review your content for adherence to our guidelines and compliance with the terms set forth in this agreement. Without limiting the foregoing, Offthewallframing shall have the right to reject to perform work on an order on any content that violates the terms or is otherwise objectionable to Offthewallframing.</li>\r\n<li>You agree that you must evaluate, and bear all risks associated with, the use of any content. In this regard, you acknowledge that you may not rely on any content, created by or submitted to, Offthewallframing. You acknowledge and agree that you are responsible for the creation and compilation of your content, and that neither Offthewallframing nor any other party involved with the production of any product incorporating such content, assumes that responsibility. Offthewallframing production of any product depicting your content does not indicate that Offthewallframing approves of the content, that the content obeys all applicable laws, or that you are absolved of any liability or harm arising from the use of the content.</li>\r\n<li>You acknowledge and agree that Offthewallframing may preserve content and may also disclose content if required to do so by law or in the good faith belief that such preservation or disclosure is reasonably necessary to.</li>\r\n<li>You comply with legal process; enforce the Agreement; respond to claims that any Content violates the rights of third-parties; or protect the rights, property, or personal safety of Image kind, its users and the public.\r\n</li>\r\n</ul>\r\n', 'uploads/featured_image/33548banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_336_banner 910x250.jpg', NULL, '', '', '', 'active', 0, 0, '2016-04-01 11:38:05', '2016-05-26 23:49:30', 0, 0),
(39, 'Privacy & Security', 'privacy-security', '3', '<p>Off the wall framing Pty Ltd respects your privacy. We collect the information required to fulfil your order / enquiry and use your information only for purposes related to the services we provide. We hold your information with the utmost care and security and we do not sell or exchange our customers’ details.</p>', 'uploads/featured_image/77939banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_542_banner 910x250.jpg', NULL, '', '', '', 'active', 0, 0, '2016-04-01 11:40:12', '2016-05-26 23:48:57', 0, 0),
(41, 'CLASSICAL ART', 'classical-art', '1', 'Off The Wall Framing has a large, ever-changing collection of classical artworks to suit a range of tastes in a variety of sizes and styles. \r\n\r\nWe also have a custom artwork service where one of our talented artists will paint an artwork to your specifications, should you not find something suitable from our range. \r\n\r\nWe are happy to share professional guidance to help you with your selection and can also assist with delivery and installation. E: offthewall.frames@hotmail.com | P: 02 9567 2422 | 425 Princes Highway, ROCKDALE NSW 2216', 'uploads/featured_image/27150classical_painting_web.jpg', NULL, 'uploads/featured_image/thumb_200x200_966_classical_painting_web.jpg', NULL, 'Classical Artwork painting', '', '', 'active', 0, 0, '2016-04-18 21:26:12', '2017-10-07 14:33:41', NULL, 0),
(42, 'Contact us', 'picture-framing-rockdale', '3', '<p class="header">\r\nFrame Shop | Showroom & Factory\r\n</p>\r\n<p>Off The Wall Framing has been Australia''s leading custom picture framing and photo framing company since 1987.</p>\r\n\r\nOff The Wall Framing PTY Ltd<br/>\r\n425 Princess Highway<br/>\r\nRockdale NSW 2216<br/>\r\nP 02 95672422     F 0295976514<br/>\r\nE offthewall.frames@hotmail.com<br/><br/><br/>\r\n<p class="header">Opening Hours</p>\r\nMonday       :  9:00 am to 4:30 pm<br/>\r\nTuesday       :  9:00 am to 4:30 pm<br/>\r\nWednesday :  9:00 am to 4:30 pm<br/>\r\nThursday      :  9:00 am to 4:30 pm<br/>\r\nFriday            :  9:00 am to 4:30 pm<br/>\r\nSaturday       :  9:00 am to 4:00 pm<br/>\r\n', 'uploads/featured_image/82189banner 910x250.jpg', NULL, 'uploads/featured_image/thumb_200x200_694_banner 910x250.jpg', NULL, 'Frame Shop | Framing Picture Since 1987 | Rockdale, Sydney', '', 'Off The Wall Framing have been Australia''s leading custom picture framing and photo framing company since 1987.', 'active', 0, 0, '2016-04-27 14:38:33', '2017-03-14 14:07:19', NULL, 0),
(44, 'FAMILY TREE FRAMING', 'family-tree-framing', '2', '', 'uploads/featured_image/16715family_web.jpg', NULL, 'uploads/featured_image/thumb_200x200_127_family_web.jpg', NULL, 'FAMILY TREE FRAMING', 'FAMILY TREE FRAMING', '', 'active', 0, 0, '2017-03-17 15:05:30', '2017-10-06 12:32:34', NULL, 0),
(45, 'Photo Frame sizes', 'photo-frame-sizes', '2', 'We have photo frames in all sizes & colours. We can also customise a frame to fit your photo.', 'uploads/featured_image/60957photo-frame-sizes-banner.jpg', NULL, 'uploads/featured_image/thumb_200x200_850_photo-frame-sizes-banner.jpg', NULL, 'Photo Frame Sizes | Standard, A4, A3, A2 A1 or Any Custom Size', 'Photo frame, a1, a2, a3, a4, standard, large, square, long, wooden, metal, white, black,', '', 'active', 0, 0, '2017-03-20 13:21:06', '2017-03-20 13:21:06', NULL, 0),
(46, 'Product Description', 'product-description', '', '<h2>Custom Picture Frames</h2>\r\n<p>Want to ornament the walls of your home or office with beautiful pictures that enhance the ambiance of your space? If you are looking for artistic picture frames to complement your décor and style, look no other than Off the Wall Framing. We offer custom online picture frame service where you can create your own picture frame of your choice using simple tools. From traditional and contemporary picture frames to sleek and ultra-modern frames, here you will find a huge choice of frames to cherish. Play around with your creativity to create frames that perfectly go with your taste and style. See live previews of the finished effect as you tweak until you get a masterpiece that beautifully captures the look and feel of your artwork. </p>\r\n<p>At Off The Wall Framing, we stock large framing supplies to turn your idea into reality. We use only high-quality wood, glass and mounts when it comes to creating frames that perfectly complement your expensive artwork and memorabilia. We are conveniently located in New South Whales to serve your simple to complex framing needs. Our bespoke frames ensure that your photos and artworks stay protected and displayed in the best possible manner. Just customize your frame, tell us the number of pictures you want to add and leave rest to us. You will be pleasantly surprised with the results after we build your frame just according to your specifications. </p>\r\n<h3>Features of our customer picture frames</h3>\r\n<ul>\r\n<li>Professional Design</li>\r\n<li>Can be customised to any size</li>\r\n<li>Made with high-quality framing materials</li>\r\n<li>Australia wide shipping</li>\r\n<li>Frame materials available in a range of timbers and metals</li>\r\n<li>Matt boards available in a huge variety of colors</li>\r\n<li>Spacers and slips options are also available</li>\r\n</ul>\r\n<h3>Features of our glass</h3>\r\n<ul>\r\n<li>Clear, non-reflective</li>\r\n<li>UV resistant</li>\r\n<li>Clear acrylic Perspex</li>\r\n<li>Highly durable</li>\r\n</ul>\r\n</p>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-06-13 16:16:17', '2017-07-13 23:27:05', NULL, 0),
(47, 'How to Order', 'how-to-order', '', '<h2>How to order a custom picture frame online</h2><p>We aim to keep this as simple, but as deep as possible. With our frame creator you can create a large variety of custom frames with millions of possible combinations. It helps having a guide to achieve what you want, we will aim to make this the most comprehensive online framing guide. The following guide will cover most cases of a custom picture frame and will explain the recommended options.\r\n			</p><ol>\r\n				<li>Enter your photo or artwork size, then click on Add a Frame:\r\n					<ol type="a">\r\n						<li>If your photo or artwork is a standard size, you can find it in our list above.\r\n						</li>\r\n						<li>Our system will build all your selections around your photo size. Please keep in mind that frames will overlap the entered size by about 4-6mm on all sides. Matboards will do the same by about 3-5mm. The ''Visible'' size is an approximation of the area including this overlap, please note that if you require a particular visible size we must be notified. Also the overlap amount will vary based on sizes and selections.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>Select a frame, you can always change this as you go.\r\n					<ol type="a">\r\n						<li>To view different sets of frames, select a colour set from the dropdown list.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>(Optional) Select a matboard:\r\n					<ol type="a">\r\n						<li>You can choose from a variety of colours to suit your frame and artwork.</li>\r\n						<li>We offer double mats too.</li>\r\n						<li>Be sure to select the thickness you would like the border to be.<br/> A (very) general rule is to match the frame width or keep it in ratio.<br/> The frame will overlap approximately 4mm on all sides of the border.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>(Optional) Select a backing:\r\n					<ol type="a">\r\n						<li>By default you will receive 3mm MDF.</li>\r\n						<li>Foamcore is an acid free product that will protect your pictures from colour fading. It is also lighter than MDF.<br/> We recommend using foamcore for most works. Use non-adhesive for original artworks/certificates.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n				<li>(Optional) Select a glass type:\r\n					<ol type="a">\r\n						<li>The default glass type is 2mm Clear Glass.</li>\r\n						<li>Non Reflective should be used in areas with lots of potential glare from natural or artificial light sources.\r\n						</li>\r\n						<li>UV Resistant Glass should be used for frames that will face direct sunlight.\r\n						</li>\r\n						<li>Perspex is highly recommended as it is durable, light and comes with 94% UV Resistance. It looks the same as clear glass and will not fade or become cloudy over time.\r\n						</li>\r\n					</ol>\r\n				</li>\r\n			</ol>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-06-13 16:16:51', '2017-06-13 16:16:51', NULL, 0),
(48, 'Shipping & Returns', 'shipping-returns', '', '<h3>Shipping</h3>\r\n			<p>We aim to ship our custom frames within 2 business days of the order coming through. Please note printing, matting and mounting options will add 1-2 business days to the production time. Depending on the location and size of the order shipping times can vary greatly, if you require anything urgently please contact us.</p>\r\n			<h3>Returns</h3>\r\n			<p>If you are not completely satisfied with the quality of the product you purchase from Off The Wall, you may return it within 7 days of the receiving date, for a full refund for the price of the product.\r\n			</p>\r\n			<p>All expenses associated with transportation of returns are the responsibility of the customer.\r\n			</p>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2017-06-13 16:17:16', '2017-06-13 16:18:13', NULL, 0);
