(29, 25, 'CLASSICAL ARTS', 'active', 'uploads/sub_article/2584135552classical-art.png', 'This is a classic artwork of "The Stolen Kiss" artwork of late 1780s can look alive at your classic-modern look. the artwork can be printed at any customized size of your request.', 0, 0, '2016-04-17 15:08:17', '2016-04-17 15:08:17'),
(30, 41, 'Classical Artworks', 'active', 'uploads/sub_article/25387floral_listing.jpg', 'Off The Wall stocks an ever-changing range of classical paintings. Our range includes originals and reproductions to suit a range of budgets. ', 0, 0, '2016-04-18 21:26:13', '2017-10-07 15:12:59'),
(32, 24, 'Silverdrop ', 'active', 'uploads/sub_article/49030Silverdrop_listing.jpg', 'Exquisite modern neutral toned, hand-painted abstract artwork with textured silver accents. This painting suits many modern interiors and brings a luxurious quality to a room. This artwork comes ready to hang with a modern silver frame. \r\nAvailable in the following sizes: <br>\r\n\r\n</br> <li> 1300 x 1900mm </li>\r\n<li> 1000 x 1500mm </li>\r\n<li> 900 x 1200mm </li>\r\n<li> 500 x 1500mm </li>', 0, 0, '2016-04-18 21:54:11', '2017-10-06 15:18:14'),
(33, 24, 'Platinium', 'active', 'uploads/sub_article/83084Platinum_listing.jpg', 'Beautiful abstract hand-painted artwork with Interesting textures and a touch of beige to suit modern / industrial decors. This artwork comes ready to hang with a modern silver frame. \r\nAvailable in the following sizes: <br>\r\n\r\n</br><li> 1000 x 1500mm </li>', 0, 0, '2016-04-18 22:06:35', '2017-10-06 14:30:02'),
(34, 23, 'Family Picture', 'active', 'uploads/sub_article/96677customized print.jpg', 'You want your family picture stretched in canvas ? We do it all the time.', 0, 0, '2016-04-18 22:22:17', '2016-04-18 22:22:17'),
(35, 23, 'Canvas Print', 'active', 'uploads/sub_article/49814CANVAS PRINT.jpg', 'You clicked something good now you want to show it to the world ? we print it on canvas and stretch it. Everything looks so professional :)', 0, 0, '2016-04-18 22:24:38', '2016-04-18 22:24:38'),
(36, 9, 'Professional Mat boards', 'active', 'uploads/sub_article/13679matt1_listing.jpg', 'Professional matboards provide two important qualities in framing. Firstly they work as a physical barrier between the artwork and the glass, which over time may result in a chemical reaction which can damage your artwork.  Matboards can also dramatically improve the overall visual effect of your framed artwork through correct colour and size choices. <br>\r\n<br/>We use professional mat boards that are classed based on their PH level and buffered against acid to ensure your artwork is conserved for future enjoyment. With hundreds of colours available to choose from, we also offer expert advice to select the correct mat board to compliment your artwork. ', 0, 0, '2016-04-18 23:10:20', '2017-09-25 14:30:23'),
(37, 9, 'Multiple Mat boards', 'active', 'uploads/sub_article/47628matt2_listing.jpg', 'Multiple mat boards can be used to create unique framing effects that add depth, colour and style. The example shows a frame with three mat boards in a stepped-curved styled border.  We use a computerised mat cutter to ensure perfect bevels and crisp cuts with millimetre accuracy. ', 0, 0, '2016-04-18 23:11:16', '2017-09-25 14:30:23'),
(38, 7, 'Customise Online', 'active', 'uploads/sub_article/47925online_listing.jpg', 'Our online framing tools allow you to draw on the master-framer within by using your creativity to select mouldings, play with the colours of mat borders and select your finishing options.  Easily upload an image of your photograph or artwork to preview your framing choices live. </br>\r\n<h3><a href="http://www.offthewallframing.com.au/custom-picture-frame">Start Designing Your Frame Now! </a></h3>', 0, 0, '2016-04-18 23:26:49', '2017-09-23 23:07:30'),
(39, 7, 'Customise Instore', 'active', 'uploads/sub_article/36789custom instore_listing.jpg', 'If you prefer to view your framing options in person or would like professional guidance, please come into our store in Rockdale, Sydney. Here we can test our sample mouldings and mat boards with your image until the perfect custom framing solution is discovered. ', 0, 0, '2016-04-18 23:28:55', '2017-09-25 10:07:17'),
(40, 8, 'Single Frame Collage ', 'active', 'uploads/sub_article/72296collage1_listing.jpg', 'Bring your favourite images together in a single frame collage. We do all kinds of collage and framing, may it be your wedding collection photos, your new born photo souvenirs or even your family photos. We can create collages with any number of images in any configuration. \r\nSupply us your pre-printed collage or a selection of images you wish to combine and we will do the hard work for you.  The end result is a professionally arranged collage in a custom made frame, ready to hang. \r\n ', 0, 0, '2016-05-14 00:13:08', '2017-09-25 12:02:37'),
(41, 8, 'Multiple Frame Collage', 'active', 'uploads/sub_article/21333collage_listing.jpg', 'Multiple Frame Collages are a great way to tell your story. Often the focal-point in a home, we will assist you to choose a layout and style that is reflective of your style. We can work with you to decide how many images to include, the size of the individual frames, if you will include feature images and your framing style and colours. \r\nTalk to us about flexible backing options should you wish to update your images in the future. ', 0, 0, '2016-05-14 00:18:56', '2017-09-25 10:10:47'),
(42, 8, 'Professional  Mat Cutter', 'active', 'uploads/sub_article/26142MATT3_listing.jpg', 'We use a professional computerised mat board cutter which allows us to create perfect-cut windows to bring your collage together. We can cut many different shapes including ovals, rectangles and even alphabet letters. Talk to us today about your collage framing options.', 0, 0, '2016-05-14 00:23:06', '2017-09-29 12:24:12'),
(43, 6, 'Canvas Stretching', 'active', 'uploads/sub_article/40312canvas corner.jpg', 'We offer stretching services to both our local and online customers. Either bring your rolled canvas into our Rockdale store or order by telephone and post your canvas to us for a quick turnaround service. ', 0, 0, '2016-05-14 01:50:15', '2017-09-19 12:20:15'),
(44, 6, 'Canvas Finishing', 'active', 'uploads/sub_article/41853streching back.jpg', 'Our work is professionally finished from every side to ensure the longevity of your stretched artwork. We only use the best acid-free materials and we select the correct size stretcher bar to ensure the frame supports your canvas without bowing or breaking. Your canvas will be tightly stretched to ensure the final result is dimple and valley free. The rear of the canvas is sealed with an acid-free adhesive to ensure your canvas will not fray and to keep dirt, dust and moisture away from the supporting frame. ', 0, 0, '2016-05-14 01:51:10', '2017-09-19 12:20:15'),
(45, 6, 'Experienced Professionals', 'active', 'uploads/sub_article/55712streching.jpg', 'Off The Wall Framing has been trusted with thousands of valuable artworks during the 30+ years we have been providing Sydney with framing services. You can be assured that we handle all artworks with respect and care.\r\nBecause we are a small team, we offer truly individual service and attention to detail and we use only high quality materials and professional tools.', 0, 0, '2016-05-14 01:52:18', '2017-09-19 12:23:35'),
(46, 6, 'Canvas Printing', 'active', 'uploads/sub_article/31791stretched-canvas.jpg', 'We also offer a wide range of custom canvas printing and stretching services. If you would like to customise your own canvas print, please contact us to discuss your needs. ', 0, 0, '2016-05-21 02:08:11', '2017-09-19 12:20:15'),
(48, 19, 'Mirror & Glass Repair', 'active', 'uploads/sub_article/44194repairs_listing.jpg', 'Off the Wall Framing provides a mirror and glass repair service. We can repair a large range of items including car door mirrors, antique mirrors, mirrored doors and table tops. Mirrors and glass can also be ordered at custom sizes and a range of thicknesses and colour. We can provide bevelled, polished or clean cut edging. ', 0, 0, '2016-05-26 21:39:16', '2017-10-05 15:13:15'),
(49, 19, 'Frame Repair', 'active', 'uploads/sub_article/21407repairs2_listing.jpg', 'Restore the glory of your older frames. We can clean the frames inside and out, replace broken glass, touch up cracks and corners, replace hanging attachments or refresh your existing frame with new professional matboard and backing using only high quality, acid-free materials. ', 0, 0, '2016-05-26 21:49:32', '2017-10-05 15:41:47'),
(50, 12, 'Acrylic Face Mounting', 'active', 'uploads/sub_article/72858crylic_listing.jpg', 'Acrylic face mounting enhances the contrast, adds sharpness and colour saturation to photographic prints for a gloss look that you cannot obtain by any other printing and framing method. Acrylic mounts are a truly stunning and unique way to display your images, capturing your attention no matter where in the room you place them. One of the most truly remarkable effects is the different feel of  acrylic mounts in different lighting - dim your lights and watch your image come alive. These are the perfect option if you are looking for something modern that is also a little different. Available in a variety of sizes, they provide an excellent gift and can be placed anywhere in the home, office or business. \r\nAcrylic mounting is hung on the wall with picture framing hooks and a special custom made bracket for larger sizes. These attachments require you to place a screw in the wall to hang. ', 0, 0, '2016-05-26 21:51:14', '2017-09-29 13:26:27'),
(51, 12, 'Acrylic Block Mounting', 'active', 'uploads/sub_article/53505acrylic mounting corner.jpg', 'Acrylic block mounting is similar to face mounting in that it enhances the contrast, sharpness and saturation of your images resulting in a high gloss effect.  Acrylic block mounts are much thicker than Acrylic face mounting as they are designed to be displayed on consoles, tables or desks and do not hang on the wall. \r\nThe Acrylic Block Mounts come in a range of sizes and are suitable for a range of purposes. ', 0, 0, '2016-05-26 21:52:15', '2017-09-29 13:26:27'),
(52, 12, 'Acrylic Finishing', 'active', 'uploads/sub_article/13120acrylic_face_mounting_wall.jpg', 'All acrylic mounts undergo a final high lustre polish, making sure your images sparkle. Polished corners also gives the image a 3D floating effect when hanging acrylic face mountings on the wall. All acrylic mounts are created in a special dust-free environment to ensure you receive your acrylic mount in flawless condition. \r\n', 0, 0, '2016-05-26 21:53:11', '2017-09-29 13:26:27'),
(53, 10, 'Canvas Wall Prints', 'active', 'uploads/sub_article/89229duncan-Modern-Wall-Paintings.jpg', 'Canvas prints have become more popular over the past few years mainly due to their relative cost effectiveness per size compared to other photographic media and mounting processes, as well as being very light, and easily hung on walls where permanent hanging hardware is not allowed. We provide high quality canvas print using high quality pigment ink that are fade resistant for long lasting prints. ', 0, 0, '2016-05-26 23:23:51', '2016-10-01 14:50:15'),
(54, 10, 'Canvas Printing', 'active', 'uploads/sub_article/13126paris canvas.jpg', 'The process is similar to a photographic print where ink is laid on the surface of the canvas. The print boasts fine detail capabilities on our acid free, water resistant surface canvas, enabling precise reproduction of very high resolution photos. Our canvases are guaranteed not to yellow, crack, or curl and are naturally acid free due to the very high content of alpha cellulose in cotton, and are made without the use of optical brighteners which are known to affect the longevity of images. At Off The Wall Framing we provide custom size prints and stretching with vertical or horizontal hanging based on your needs, to fit anywhere you intend to place it.', 0, 0, '2016-05-26 23:24:36', '2016-10-01 14:47:01'),
(59, 18, '3D Frames', 'active', 'uploads/sub_article/277473D framing.jpg', 'Our wide range of 3 Dimensional Frames are the perfect way to beautifully display and protect your special souvenirs. Over the years we have framed a large variety of mementos, such as cricket bats and balls, jewelries such as necklaces, watches and bracelets, favourite Tee, Vinyls and many more. \r\n\r\nOur Frames are all Australian made and are of high quality timbers. Our services can be fully customised according to the product you want to frame. You can chose the frame sizes and colours, the matting options that allow you to select the top and background mats as well as adding a double mat. We also provide assistance in choosing the best options if needed.', 0, 0, '2016-06-03 01:55:09', '2016-10-01 12:36:57'),
(61, 11, 'Mirror Framing', 'active', 'uploads/sub_article/79561photo mirror.jpg', 'The mirror framing is perfect and neat as you want your picture to be framed.', 0, 0, '2016-06-03 21:44:22', '2016-06-03 21:44:22'),
(62, 11, 'Framing corner', 'active', 'uploads/sub_article/27574top corner.jpg', 'The Mirror frame corners are so precise and perfect, easy on your eyes too.', 0, 0, '2016-06-03 21:45:49', '2016-06-03 21:45:49'),
(63, 11, 'Mirror frame', 'active', 'uploads/sub_article/78248photo framing corner1.jpg', 'Our qork and service quality for Mirror frame and everything else is picture perfect.', 0, 0, '2016-06-03 21:47:12', '2016-06-03 21:47:12'),
(64, 17, 'Memorabilia', 'active', 'uploads/sub_article/18758memorabilia.jpg', 'You have any memory you want to preserve, just frame it with us.', 0, 0, '2016-06-03 23:07:48', '2016-06-03 23:07:48'),
(65, 17, 'Sports memorabilia', 'active', 'uploads/sub_article/95116sports memor.jpg', 'just want to frame anything, contact us.', 0, 0, '2016-06-03 23:08:48', '2016-06-03 23:08:48'),
(66, 17, 'Medal Framing', 'active', 'uploads/sub_article/28974matt.jpg', 'With our professional work and a plaque, show off your achievements.', 0, 0, '2016-06-03 23:10:03', '2016-06-03 23:12:04'),
(67, 15, 'Box Framing', 'active', 'uploads/sub_article/33803sports memor.jpg', 'Bring us anything, we wont disappoint you.', 0, 0, '2016-06-03 23:11:03', '2016-06-03 23:11:03'),
(68, 16, 'Sports Jerseys', 'active', 'uploads/sub_article/71021jersy_listing.jpg', 'Off The Wall Framing are specialist jersey framers. We offer a number of solutions to protect and display your winning teams'' colours to suit a range of budgets. Combine photographs or a plaque to truly customise your framed jersey.  Quick turnaround times. ', 0, 0, '2016-06-03 23:13:58', '2017-09-20 11:52:50'),
(69, 16, 'Military Service Medals', 'active', 'uploads/sub_article/47413medal_listing.jpg', 'Preserve your family''s military service heritage by displaying medals in a custom-made frame.  Recognise the contributions of one person or combine a number of generations into the one family service display. You may choose to include medals, photographs, service history, maps of places served or others keepsakes to create a unique tribute to the service and sacrifices made for country. ', 0, 0, '2016-06-03 23:14:55', '2017-09-20 11:51:15'),
(70, 43, 'Frame A Memory', 'active', 'uploads/sub_article/41306custom-framing-shadow-box.jpg', 'We specialise in custom framing. Our staff are here to provide you with professional service and advice in all facets of picture framing. We will assist you with suitable custom framing combinations, to suit the object you wish to frame with the best possible style and colour choice to suit your decor and budget.', 0, 0, '2016-09-22 23:33:25', '2016-09-22 23:41:28'),
(71, 43, 'Sports Memorabilia Framing', 'active', 'uploads/sub_article/18248jersey_frame 1.jpg', 'Looking to get your favourite sporting memorabilia framed so you can display its greatness on the wall, come to Sydney''s premier custom framers for sporting display with style. Whether it is a past memory or a cricket bat, jerseys, medals, wedding tapestries and bouquets, our team of framers give professional advice and inspiration, tailor-made to the perfection. \r\n\r\nWe offer a broad range while recommending the best in preservative materials to save your prized memorabilia from deterioration. \r\n', 0, 0, '2016-09-22 23:36:02', '2016-09-23 00:22:11'),
(72, 43, 'Custom Framing Rockdale', 'active', 'uploads/sub_article/79322custom-framing-rockdale.jpg', 'We are one of the most experience picture framing stores in Sydney since 1987, so come and visit our showroom & factory, where you can select from our large range of frames and acid free mount boards. Custom, computerized, decorative mount cutting available. All framing work is completed on the premises at <h5>425 Princess Highway, Rockdale NSW 2216</h5> by our experienced picture framers. Call us on (02) 95672422 for any inquiry you may have to frame your object.', 0, 0, '2016-09-23 00:19:58', '2017-03-12 07:56:11'),
(73, 44, 'FAMILY TREE FRAMING', 'active', 'uploads/sub_article/89907familytree_listing.jpg', 'Record and display your heritage with a framed family tree. We custom make your frame to suit a range of design styles suitable for your family home. Perfect for family gifts or as a heirloom piece. ', 0, 0, '2017-03-17 15:05:30', '2017-10-06 12:04:58'),
