(87, 45, 'STANDARD SIZE 50 X 70 CM WITH MAT (57.8 X 77.8 CM)', 'active', 'uploads/sub_article/67941thumb_158_black with mat A4.jpg', '<p>STANDARD SIZE 50 X 70 CM WITH MAT (57.8 X 77.8 CM),</br>\r\nWodern or Timber</br>\r\nBlack, White, Gold, Silver with any colour Mat Board</p>\r\n<p>\r\n <a href="/photo-frames/standard-size-50-x-70-cm-with-mat-578-x-778-cm"><font size="4">Click here to view our standard selections.</font></a></p>\r\n<p> If you need a customised photo frame please click below to view our wooden frame selections. We have 100''s of styles & molds in all colours.\r\n</br></br> <a href="/photo-frames/wooden-photo-frame-selection"><font size="4">Customised Wooden Photo Frame Selections.</font></a></p>', 0, 0, '2017-03-23 15:27:39', '2017-03-23 15:28:09'),
(88, 45, 'STANDARD SIZE 60 X 80 CM WITH MAT (67.8 X 87.8 CM)', 'active', 'uploads/sub_article/49002thumb_158_black with mat A4.jpg', '<p>STANDARD SIZE 50 X 70 CM WITH MAT (57.8 X 77.8 CM),</br>\r\nWodern or Timber</br>\r\nBlack, White, Gold, Silver with any colour Mat Board</p>\r\n<p>\r\n <a href="/photo-frames/standard-size-60-x-80-cm-with-mat-678-x-878-cm"><font size="4">Click here to view our standard selections.</font></a></p>\r\n<p> If you need a customised photo frame please click below to view our wooden frame selections. We have 100''s of styles & molds in all colours.\r\n</br></br> <a href="/photo-frames/wooden-photo-frame-selection"><font size="4">Customised Wooden Photo Frame Selections.</font></a></p>', 0, 0, '2017-03-23 15:29:33', '2017-03-23 15:29:33'),
(89, 45, 'STANDARD SIZE 60 X 90 CM WITH MAT (67.8 X 97.8 CM)', 'active', 'uploads/sub_article/73870thumb_158_black with mat A4.jpg', '<p>STANDARD SIZE 60 X 90 CM WITH MAT (67.8 X 97.8 CM),</br>\r\nWodern or Timber</br>\r\nBlack, White, Gold, Silver with any colour Mat Board</p>\r\n<p>\r\n <a href="/photo-frames/standard-size-60-x-90-cm-with-mat-678-x-978-cm"><font size="4">Click here to view our standard selections.</font></a></p>\r\n<p> If you need a customised photo frame please click below to view our wooden frame selections. We have 100''s of styles & molds in all colours.\r\n</br></br> <a href="/photo-frames/wooden-photo-frame-selection"><font size="4">Customised Wooden Photo Frame Selections.</font></a></p>', 0, 0, '2017-03-23 15:31:04', '2017-03-23 15:31:28'),
(90, 45, 'WOODEN PHOTO FRAME SELECTION', 'active', 'uploads/sub_article/56927thumb_484_A66603.jpg', '<p>Wooden & Timber Picture Frames | Wooden and Timber photo frames cover a wide variety of styles and shades of wood. </br>\r\nWonder or Timber</br>\r\nIn our frame range we have wood veneer, dark, rustic, light aged, hand finished and modern chocolate mocca in all sorts of shapes and sizes,</p>\r\n<p>\r\n <a href="/photo-frames/wooden-photo-frame-selection"><font size="4">Click here to view our standard selections.</font></a></p>\r\n<p> If you need a customised photo frame please click below to view our wooden frame selections. We have 100''s of styles & molds in all colours.\r\n</br></br> <a href="/photo-frames/wooden-photo-frame-selection"><font size="4">Customised Wooden Photo Frame Selections.</font></a></p>', 0, 0, '2017-03-23 15:35:20', '2017-03-23 15:36:49'),
(91, 16, 'Preservation', 'active', 'uploads/sub_article/36801bat_listing.jpg', 'Memorabilia framing is popular not simply for displaying your precious memories, it is also a great way to preserve key items. Whether you have art objects, inherited family heirlooms, reminders of people, times and places or that much-envied sporting trophy, framing will protect your memorabilia for many years to come. We use professional tools and acid-free materials to ensure the care and safety of your special objects both during the framing process and into the future. ', 0, 0, '2017-09-20 11:12:29', '2017-09-20 11:51:15'),
(92, 16, 'Customise', 'active', 'uploads/sub_article/20444boxing_listing.jpg', 'Memorabilia of almost any shape and size can be framed. Contact us to discuss your unique needs and we will provide you with a range of solutions from traditional frames, shadowbox frames and acrylic display boxes. ', 0, 0, '2017-09-20 11:18:37', '2017-09-20 11:51:15'),
(94, 19, 'Image Restoration', 'active', 'uploads/sub_article/23221repairs3_listing.jpg', 'Restore your old photographs and artworks. We can create digital and printed restorations free of creases, \r\nstains, rips, missing edges, water damage, acid-damage and fading. \r\n\r\nWe can remove any unwanted areas of the image including changing backgrounds and removing people, objects or text. ', 0, 0, '2017-10-05 15:13:15', '2017-10-05 15:52:51'),
(95, 24, 'Triumph', 'active', 'uploads/sub_article/57580triumph_listing.jpg', 'Multi-layered textured elements bring a level of depth to this fabulous hand-painted abstract artwork. Sparkling silver accents combine with a modern silver frame to lift this artwork and present a beautifully balanced composition. \r\nAvailable in the following sizes: <br>\r\n\r\n</br> <li> 1300 x 1900mm </li>\r\n<li> 1000 x 1500mm </li>\r\n\r\n', 0, 0, '2017-10-06 14:18:41', '2017-10-06 14:30:02'),
(96, 24, 'Wave', 'active', 'uploads/sub_article/26688wave_listing.jpg', 'Magnificent  hand-painted artwork with iridescent qualities and curves inspired by nature.  This modern abstract is set off against a black  frame. Available  in the  following sizes: <br>\r\n\r\n</br> <li> 1300 x 1900mm </li>\r\n<li> 1000 x 1500mm </li>\r\n<li> 500 x 1500mm </li>', 0, 0, '2017-10-06 14:30:02', '2017-10-06 14:30:02'),
(97, 24, 'Stirling', 'active', 'uploads/sub_article/59389Stirling_listing.jpg', 'Beautiful silver toned hand-painted abstract painting ideal for narrower spaces. Comes with a classic black frame and available in the following size: <br>\r\n\r\n</br> <li> 500 x 1500 mm </li>\r\n', 0, 0, '2017-10-06 15:54:06', '2017-10-06 15:54:06'),
(98, 24, 'Sapphire', 'active', 'uploads/sub_article/66480sapphire_listing.jpg', 'Exquisite neutral toned painting with brilliant turquoise accents and textured elements. Perfect for the modern interior where a splash of colour is desired. This design also comes in red as the ''Ruby''. Ready to hang with a modern silver frame and available in the following sizes: <br>\r\n\r\n</br> <li> 1300 x 1900mm </li>\r\n<li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 10:38:20', '2017-10-07 10:38:20'),
(99, 24, 'Ruby', 'active', 'uploads/sub_article/80131ruby_listing.jpg', 'Exquisite neutral toned painting with  luscious scarlet and red accents as well as textured elements. Perfect for the modern interior where a splash of colour is desired. This design also comes in turquoise as the ''Sapphire''. Ready to hang with a modern silver frame and available in the following sizes: <br>\r\n\r\n</br> <li> 1300 x 1900mm </li>\r\n<li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 10:40:38', '2017-10-07 10:40:38'),
(100, 24, 'Aquarise', 'active', 'uploads/sub_article/30786aquarise_listing.jpg', 'Modern abstract hand-painted artwork featuring colourful blue, turquoise and pink tones with golden yellow accents. This painting features a high gloss finish, sealing in rich vibrant hues. Ready to hang and available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 10:46:40', '2017-10-07 10:46:40'),
(101, 24, 'Azure', 'active', 'uploads/sub_article/61986azure_listing.jpg', 'Beautiful modern artwork with blue and silver tones. This painting features a high gloss finish, sealing in rich vibrant hues. Ready to hang with a modern black frame and available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 10:53:23', '2017-10-07 10:53:23'),
(102, 24, 'Fiesta', 'active', 'uploads/sub_article/64540fiesta_listing.jpg', 'Vibrant and colourful abstract artwork featuring rich luxurious paint textures and a high gloss finish . Ready to hang and available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 10:55:48', '2017-10-07 11:10:10'),
(103, 24, 'Horizon', 'active', 'uploads/sub_article/60818Horizon_listing.jpg', 'Strong horizontal composition and colourful tones create this vibrant artwork reminiscent of the Australian landscape.  This painting is sealed with a high gloss finish and is ready to hang. Available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 11:10:10', '2017-10-07 11:10:10'),
(104, 24, 'Night Sky', 'active', 'uploads/sub_article/23403Might sky_listing.jpg', 'Beautiful modern artwork with blue and black tones. This painting features a high gloss finish, sealing in rich vibrant hues. Ready to hang and available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 11:12:09', '2017-10-07 11:12:09'),
(105, 24, 'Ocean', 'active', 'uploads/sub_article/99182ocean_listing.jpg', 'The Ocean paintings are all different due to the nature of the paint flow used to create these captivating artworks. The palette includes the deep green of ocean hues mixed with turquoise, aquas and touches of white. Ready to hang and available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 11:15:08', '2017-10-07 11:15:08'),
(106, 24, 'Vibrant', 'active', 'uploads/sub_article/35674vibrant_listing.jpg', 'A truly colourful hand-painted abstract featuring a high gloss finish providing a luxurious feel and depth of colour. Ready to hang and available in the following size: <br>\r\n\r\n</br> <li> 1200 x 1700mm </li>', 0, 0, '2017-10-07 11:35:11', '2017-10-07 11:35:11'),
(107, 24, 'Trafalgar', 'active', 'uploads/sub_article/24933Trafalger_listing.jpg', 'Beautiful modern abstract hand-painted artwork. Striking colours combined with a thick textural painting style and a high gloss finish define this painting. Ready to hang and available in the following size: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>', 0, 0, '2017-10-07 11:38:40', '2017-10-07 11:38:40'),
(108, 24, 'Paris', 'active', 'uploads/sub_article/76159Paris_listing.jpg', 'An exquisite painting on a neutral background with turquoise and purple accents.  Ready to hang and also available in a narrower format for smaller spaces. Paris is available in the following sizes: <br>\r\n\r\n</br> <li> 1000 x 1500mm </li>\r\n<li> 500 x 1500mm </li>', 0, 0, '2017-10-07 12:09:26', '2017-10-07 12:09:26'),
(110, 41, 'Figurative Artworks', 'active', 'uploads/sub_article/88031figurative_listing.jpg', 'We have a large variety of figurative hand-painted artworks in a range of sizes and styles.', 0, 0, '2017-10-07 15:12:59', '2017-10-07 15:12:59');
