INSERT INTO `printing` (`id`, `type`, `title`, `slug`, `description`, `status`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(2, 'option', 'Luster Semi-Gloss Paper', 'luster-paper', '<ul>\r\n	<li>\r\n	<h4>Paper Details</h4>\r\n	</li>\r\n	<li>Industry standard professional photographic paper</li>\r\n	<li>Perfect for all types of photographs and portraits</li>\r\n	<li>Partial gloss and reflection of light</li>\r\n	<li>90 Year Archival Rating</li>\r\n	<li>Chromajet Centurion Silk 285gsm</li>\r\n</ul>\r\n', 'active', 0, 0, '2017-07-12 20:28:26', '2017-06-11 12:35:39'),
(3, 'option', 'Matte (Poster) Paper', 'poster-matte-paper', '<ul>\r\n	<li>\r\n	<h4>Paper Details</h4>\r\n	</li>\r\n	<li>High quality white matte paper</li>\r\n	<li>No gloss or reflections</li>\r\n	<li>Great for posters and reproductions</li>\r\n	<li>Chromajet Hi-Res 180gsm</li>\r\n</ul>\r\n', 'active', 0, 0, '2017-07-12 20:28:33', '2017-06-11 12:36:12'),
(4, 'option', 'Full Gloss Paper', 'gloss-paper', '<ul>\r\n	<li>\r\n	<h4>Paper Details</h4>\r\n	</li>\r\n	<li>High gloss and reflection of light</li>\r\n	<li>90 Year Archival Rating</li>\r\n	<li>Chromajet Centurion FullGloss 255gsm</li>\r\n	<li>\r\n	<div class="alert alert-info">Please ensure to select a mat or elevation with this paper to avoid the glass touching it.</div>\r\n	</li>\r\n</ul>\r\n', 'active', 0, 0, '2017-07-12 20:28:40', '2017-06-11 12:36:40'),
(5, 'option', 'Metallic High Gloss Paper', 'metallic-paper', '<ul>\r\n	<li>\r\n	<h4>Paper Details</h4>\r\n	</li>\r\n	<li>Amazing glossy metallic reflections</li>\r\n	<li>Highlights vibrant colours with pealescent finish</li>\r\n	<li>Incredible image clarity</li>\r\n	<li>Chromajet Metallic Pearl 255gsm</li>\r\n</ul>\r\n', 'active', 0, 0, '2017-07-12 20:28:49', '2017-06-11 12:37:05'),
(6, 'option', 'Archival Matte (Fine Art) Paper', 'archival-paper', '<ul>\r\n	<li>\r\n	<h4>Paper Details</h4>\r\n	</li>\r\n	<li>Textured fine art paper</li>\r\n	<li>Off-white colour</li>\r\n	<li>Best suited to black and white images</li>\r\n	<li>Gives character to digital art</li>\r\n	<li>Highest Archival Standard</li>\r\n	<li>Hahnemuhle Photo Rag Ultra Smooth 188gsm</li>\r\n</ul>\r\n', 'inactive', 0, 0, '2017-07-14 04:06:17', '2017-07-14 15:06:17'),
(7, 'information', 'Printer Information', 'printer-information', 'All printing and calibration performed professionally on site using Canon iPF8100 printer with a 12 colour pigment ink system.\r\n', 'active', 0, 0, '2017-07-14 03:17:29', '2017-07-14 14:17:29');
