(8, NULL, 10, 9, 'Circle Bathroom mirror', 'circle-bathroom-mirror', '<p>This Circle bathroom mirror can be both stylish and functional featuring a striking circle shape. It comes complete with all the necessary fittings for a quick and easy installation.</p>\r\n\r\n<ul>\r\n	<li>Neat and Simple</li>\r\n	<li>Attractive, modern design mirror</li>\r\n	<li>Quick and easy to install</li>\r\n	<li>All fittings included</li>\r\n</ul>\r\n\r\n<p>We have different sizes with this design to match your requirements.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>M3</td></tr>\r\n<tr><td>Sizes</td><td>760 mm diameter</td></tr>\r\n<tr><td>Other sizes</td><td>Made to Order</td></tr><tr>\r\n<td>Stock Level</td><td>6</td></tr>\r\n</table>', 'inactive', NULL, 'Product', NULL, '249', '0', NULL, NULL, NULL, '6', 'no', 0, 0, '2016-03-13 19:01:01', '2017-10-09 13:10:29', 'No', 'uploads/product_image/998circle-bathroom-mirror.jpg', 'uploads/product_image/thumb_760_circle-bathroom-mirror.jpg', '', '', '', '', '', 0, 0, 0, '', '', '', 'circle-bathroom-mirror', '', 'circle-bathroom-mirror Meta keywords', 'circle-bathroom-mirror Meta descriptions'),
(9, NULL, 10, 9, 'Oval Bathroom mirror', 'oval-bathroom-mirror', '<p>Our mirrors are tested to deal with high humidity areas like our bathroom; however not limited and Ideal for use in any room, this Bevel edged oval bathroom mirror can add stylish practicality to any space. It comes complete with all the necessary fittings for a quick and easy installation.</p>\r\n\r\n<ul>\r\n	<li>Neat and Simple</li>\r\n	<li>Attractive, modern design mirror</li>\r\n	<li>Quick and easy to install</li>\r\n	<li>All fittings included</li>\r\n</ul>\r\n\r\n<p>We can customize the product as per your size requirement.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>M1</td></tr>\r\n<tr><td>Sizes</td><td>870 x 580 mm</td></tr>\r\n<tr><td>Other sizes</td><td>Made to Order</td></tr>\r\n<tr><td>Stock Level</td><td>11</td></tr>\r\n</table>', 'inactive', NULL, 'Product', NULL, '120', '190', NULL, NULL, NULL, '1', 'no', 0, 0, '2016-03-13 19:06:26', '2016-06-11 01:14:45', 'No', 'uploads/product_image/390oval-bathroom-mirror.jpg', 'uploads/product_image/thumb_782_oval-bathroom-mirror.jpg', '', '', '', '', '', 0, 0, 0, 'M1', '870 x 580 mm', 'Made to Order', 'OVAL BATHROOM MIRROR', '', '', ''),
(10, NULL, 10, 9, 'Rectangle Bathroom mirror', 'rectangle-bathroom-mirror', '<p>Our mirrors are tested to deal with high humidity areas like our bathroom. Ideal for use in any room, this silver framed rectangular bathroom mirror can be hung either horizontally or vertically, depending on your needs. It comes complete with all the necessary fittings for a quick and easy installation.</p>\r\n\r\n<ul>\r\n	<li>Neat and Simple</li>\r\n	<li>Attractive, modern design mirror</li>\r\n	<li>Can be hung horizontally or vertically</li>\r\n	<li>Quick and easy to install</li>\r\n	<li>All fittings included</li>\r\n</ul>\r\n\r\n<p>We can customize the product as per your size requirement.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>M1</td></tr>\r\n<tr><td>Sizes</td><td>750 x 1000 mm</td></tr>\r\n<tr><td>Other sizes</td><td>Made to Order</td></tr>\r\n<tr><td>Stock Level</td><td>14</td></tr>\r\n</table>', 'inactive', NULL, 'Product', NULL, '60', '80', NULL, NULL, NULL, '12', 'no', 0, 0, '2016-03-13 19:08:09', '2016-06-11 01:15:07', 'No', 'uploads/product_image/310rectangle-bathroom-mirror.jpg', 'uploads/product_image/thumb_747_rectangle-bathroom-mirror.jpg', '', '', '', '', '', 0, 0, 0, 'M1', '750 x 1000 mm', 'Made to Order', 'Rectangle Bathroom mirror', '', '', ''),
(13, NULL, 10, 12, 'Silver Ornate Mirror', 'silver-ornate-mirror', '<p>This silver ornate mirror has a perfect finish and elaboration which is ideal to go over a mantel. A classic and elegant piece that can elevate the space its in.</p>\r\n\r\n<p>Suitable for use in bathrooms, interior design or any indoor area.</p>\r\n\r\n<p>All mirrors come with a 10 year warranty and are made to Australian Standards using 6 mm thick glass and acid-free materials.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>OM3</td></tr>\r\n<tr><td>Sizes</td><td>1000 x 800 mm</td></tr><tr><td>Other sizes</td><td>Made to Order</td></tr><tr>\r\n<td>Stock Level</td><td>8</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, 'Call us for prices', '', NULL, NULL, NULL, '4', 'no', 0, 0, '2016-03-13 19:21:13', '2017-07-07 17:52:12', 'Yes', 'uploads/product_image/325silver-mantel-ornate-mirror.jpg', 'uploads/product_image/thumb_913_silver-mantel-ornate-mirror.jpg', '', '', '', '', '', 0, 0, 0, 'OM3', '1000 x 800 mm', 'Made to Order', 'silver-ornate-mirror-mantelpiece', '', '', ''),
(14, NULL, 10, 17, 'Free Standing Mirror', 'free-standing-mirror', '<p>This antique design, ornate, wall mirror will make a beautiful addition to any room in the house, from the dining room to the bedroom. this can bring the functionality and the style on any place it be. We have different sizes to match your requirements.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>M2</td></tr>\r\n<tr><td>Sizes</td><td>750 x 1000 mm</td></tr>\r\n<tr><td>Other sizes</td><td>Made to Order</td></tr>\r\n<tr><td>Stock Level</td><td>8</td></tr>\r\n</table>', 'inactive', NULL, 'Product', NULL, '320', '480', NULL, NULL, NULL, '4', 'no', 0, 0, '2016-03-13 19:23:22', '2016-05-06 20:10:42', 'Yes', 'uploads/product_image/461FREE-STANDING-MIRROR.jpg', 'uploads/product_image/thumb_845_FREE-STANDING-MIRROR.jpg', '', '', '', '', '', 0, 0, 0, 'M2', '750 x 1000 mm', 'Made to Order', 'Free Standing Mirror', '', '', ''),
(15, NULL, 10, 17, 'Neat Floor Mirror', 'neat-floor-mirror', '<p>Full Length Free Standing Mirror, with Silver beaded trim with Bevel Edges. A mix between classical and modern style sure to stun anyone and any place. We have different sizes to match your requirements.</p>\r\n', '<table class="table">\r\n<tr><td>Product Code</td><td>FSM1</td></tr>\r\n<tr><td>Sizes</td><td>2000 x 1100 mm</td></tr>\r\n<tr><td>Other sizes</td><td>Made to Order</td></tr>\r\n<td>Stock Level</td><td>18</td></tr>\r\n</table>', 'active', NULL, 'Product', NULL, '295', '320', NULL, NULL, NULL, '18', 'no', 0, 0, '2016-03-13 19:30:53', '2016-08-30 15:22:00', 'No', 'uploads/product_image/123NEAT-FLOORMIRRORS.jpg', 'uploads/product_image/thumb_649_NEAT-FLOORMIRRORS.jpg', '', '', '', '', '', 0, 0, 0, 'FSM1', '2000 x 1100 mm', 'Made to Order', 'Neat Floor Mirror', '', '', ''),
(16, NULL, 10, 15, 'Square Bevelled Mirror', 'square-bevelled-mirror', '<p>A classic mirror with simple bevelled edges which can be hung vertically or horizontally. Lovely classic piece without being pretentious or distracting.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '149', '', NULL, NULL, NULL, '8', 'no', 0, 0, '2016-04-05 22:53:54', '2016-06-11 01:15:45', 'No', 'uploads/product_image/138square beveled mirror.jpg', 'uploads/product_image/thumb_162_square beveled mirror.jpg', '', '', '', '', '', 0, 0, 0, 'BM1', '60cm x 60cm', '90cm x 90cm', 'Square Bevelled Mirror', 'Pickup only available.', '', ''),
(17, NULL, 10, 12, 'Ornate Square Mirror', 'ornate-square-mirror', '<p>This Square Ornate Mirrors is all about the perfect size and perfect fit for your classical theme interiors. Perfect to go above your mantel or lit up your hallway.<br />\r\nThis is a special editions and only available till stocks last. You might want to confirm the size and color you want and order them right away !</p>\r\n\r\n<p>We have two standard sizes available on this design and different colours to choose from</p>\r\n\r\n<p>SILVER<br />\r\nBLACK<br />\r\nWHITE</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '299', '', NULL, NULL, NULL, '5', 'no', 0, 0, '2016-04-08 00:23:56', '2017-05-26 11:36:50', 'No', 'uploads/product_image/746ornate-square-mirror.jpg', 'uploads/product_image/thumb_597_ornate-square-mirror.jpg', '', '', '', '', '', 0, 0, 0, 'MIR10402', '36 x 48 cm', '24 x 48 cm', 'ornate-square-mirror-classic', '', '', ''),
(18, NULL, 10, 12, 'Traditional rectangle mirror', 'traditional-rectangle-mirror', '<p>This silver Ornate mirror has a perfect finish and elaboration which is ideal to go over a mantel. A classic and elegant piece that can elevate the space its in.<br />\r\nWe have two standard sizes available on this design and different colours to choose from</p>\r\n\r\n<p>SILVER<br />\r\nBLACK<br />\r\nWHITE</p>\r\n', '', 'inactive', NULL, 'Product', NULL, 'Call us for prices', '', NULL, NULL, NULL, '6', 'no', 0, 0, '2016-04-08 01:26:11', '2017-05-25 15:52:23', 'No', 'uploads/product_image/1586860S.jpg', 'uploads/product_image/thumb_756_6860S.jpg', '', '', '', '', '', 0, 0, 0, 'MIR10602', '36 x 48 cm', '24 x 48 cm', 'traditional-rectangle-mirror-mantel', '', '', ''),
(21, NULL, 10, 16, 'Large Mirror', 'large-mirror', '<p>Large Mirror to fill your space with great timber look.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '250', '', NULL, NULL, NULL, '1', 'no', 0, 0, '2016-04-14 01:25:11', '2017-03-14 10:23:47', 'Yes', 'uploads/product_image/800classic-large-rectangle.jpg', 'uploads/product_image/thumb_202_classic-large-rectangle.jpg', '', '', '', '', '', 0, 0, 0, '', '88 x 190 cm', '', 'large-mirror-timber', '', '', ''),
(22, NULL, 10, 11, 'Round Modern Mirror', 'round-modern-mirror', '<p>This is a neat and elegant mirror with a preety touch. The white colour and the bow crown will definatley enhance your girly look.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '189', '', NULL, NULL, NULL, '2', 'no', 0, 0, '2016-04-14 01:29:11', '2017-05-30 15:33:54', 'Yes', 'uploads/product_image/846WHITE ROUND MIRROR.jpg', 'uploads/product_image/thumb_587_WHITE ROUND MIRROR.jpg', '', '', '', '', '', 0, 0, 0, '', '90 cm (Outside Diameter)', '', 'round-modern-mirror', '', '', ''),
(23, NULL, 10, 11, 'Round Modern Timber Mirror', 'round-modern-timber-mirror', '<p>This modern mirror has a timber look ar the frames. just the right balance between modern and classic look.</p>\r\n\r\n<p>Mirro Outer Measurement is 77 cm and mirrors measurement is 47 cm.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '120', '', NULL, NULL, NULL, '5', 'no', 0, 0, '2016-04-14 01:32:13', '2017-05-30 15:34:27', 'Yes', 'uploads/product_image/234round modern mirror.jpg', 'uploads/product_image/thumb_246_round modern mirror.jpg', '', '', '', '', '', 0, 0, 0, '', '77 cm (Outer Diameter)', '', 'round-modern-timber-mirror-greek', '', '', ''),
(24, NULL, 11, 21, 'Modern  Rectangle Mirror', 'modern-rectangle-mirror', '<p>This is a large mirror with a modern look. Also blends well with the classis modern look of your furnitures.</p>\r\n', '', 'active', NULL, 'Product', NULL, '189', '', NULL, NULL, NULL, '-3', 'no', 0, 0, '2016-04-14 01:34:23', '2017-03-21 13:17:53', 'Yes', 'uploads/product_image/884large-mirror.jpg', 'uploads/product_image/thumb_383_large-mirror.jpg', '', '', '', '', '', 0, 0, 220, '', '1000 x 1300 cm', '', 'modern--rectangle-mirror', 'Pickup only', '', ''),
(26, NULL, 10, 14, 'Modern Round Shaped Mirror', 'modern-round-shaped-mirror', '<p><span style="color:rgb(121, 121, 121); font-family:open sans,sans-serif">This modern mirror has a timber look ar the frames. just the right balance between modern and classic look.</span></p>\r\n\r\n<p><span style="color:rgb(121, 121, 121); font-family:open sans,sans-serif">Outer Measurement is 77 cm and inner mirror&nbsp;measurement is 47 cm.</span></p>\r\n', '', 'active', NULL, 'Product', NULL, '120', '', NULL, NULL, NULL, '5', 'no', 0, 0, '2016-04-14 20:31:31', '2016-04-14 20:31:59', 'Yes', 'uploads/product_image/938greek-round-mirror.jpg', 'uploads/product_image/thumb_493_greek-round-mirror.jpg', '', '', '', '', '', 0, 0, 0, '', '', '', 'round-shaped-mirror-greek', '', '', ''),
(27, NULL, 10, 14, 'Modern Round Mirror', 'modern-round-mirror', '<p>This is a neat and elegant mirror with a preety touch. The white colour and the bow crown will definatley enhance your girly look.</p>\r\n', '', 'active', NULL, 'Product', NULL, '189', '', NULL, NULL, NULL, '2', 'no', 0, 0, '2016-04-14 20:35:28', '2016-04-14 20:35:28', 'Yes', 'uploads/product_image/708round-modern-mirror.jpg', 'uploads/product_image/thumb_854_round-modern-mirror.jpg', '', '', '', '', '', 0, 0, 0, '', '', '', 'modern-round-mirror-white', '', '', ''),
(28, NULL, 10, 11, 'Rectangular Modern Mirror', 'rectangular-modern-mirror', '<p>This Large Mirror should fit perfect in your Hallway or you Bedroom. Colour available only in black.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '199', '', NULL, NULL, NULL, '9', 'no', 0, 0, '2016-04-14 21:06:33', '2017-03-14 10:02:56', 'Yes', 'uploads/product_image/235mordern large-mirror.jpg', 'uploads/product_image/thumb_632_mordern large-mirror.jpg', '', '', '', '', '', 0, 0, 0, '', '820 x 1150 mm', '', 'rectangular-modern-mirror-timber', '', '', ''),
(29, NULL, 10, 12, 'Traditional Large Mirror', 'traditional-large-mirror', '<p>This Large mirror have a traditional bold look. we have it in antique pewtwer and black with 2 different sizes. Perfect size and texture to give your hallway a bold look. Can be hanged vertically or horizontally to fit your space.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '450', '', NULL, NULL, NULL, '5', 'no', 0, 0, '2016-04-14 21:22:54', '2017-05-26 11:37:39', 'No', 'uploads/product_image/227TST001S-1.jpg', 'uploads/product_image/thumb_805_TST001S-1.jpg', '', '', '', '', '', 0, 0, 0, '', '1300 x 1000 mm', '1400 x 2200 mm', 'traditional-large-mirror', '', '', ''),
(30, NULL, 10, 12, 'Antique White Mirror', 'antique-white-mirror', '<p>Antique style Mirror.</p>\r\n', '', 'inactive', NULL, 'Product', NULL, '329', '', NULL, NULL, NULL, '4', 'no', 0, 0, '2016-04-15 20:19:52', '2017-05-26 11:34:05', 'No', 'uploads/product_image/800antique white mirror.jpg', 'uploads/product_image/thumb_934_antique white mirror.jpg', '', '', '', '', '', 0, 0, 0, '', '360 x 480 mm', '240 x 480 mm', 'antique mirror-white', '', '', ''),
