(325, NULL, 10, 11, 'Modern Beaded Mirror 750x600mm', 'modern-beaded-mirror-750x600mm', '<p>Modern beaded detail mirror.&nbsp;This mirror is 750 x 600 mm and&nbsp;other sizes are available. &nbsp;All sizes are in millimetres, rounded up to the nearest 5 mm, measured at the widest points.</p>\r\n\r\n<p>Suitable for use in bathrooms, interior design or any indoor area.</p>\r\n\r\n<p>All mirrors come with a 10 year warranty and are made to Australian Standards using 6 mm thick glass and acid-free materials.</p>\r\n\r\n<p>Please contact us if you would like more details about this product.&nbsp;</p>\r\n', '', 'active', NULL, 'Product', NULL, 'Call us for prices', '', NULL, NULL, NULL, '5', 'no', 0, 0, '2016-06-04 01:24:24', '2017-05-31 12:39:47', 'No', 'uploads/product_image/651923bead.jpg', 'uploads/product_image/thumb_560_923bead.jpg', '', '', '', '', '', 0, 0, 0, '923', '750 x 600mm', '1000 x 700, 1200 x 900, 1400 x 500, 1400 x 800, 1400 x 1100, 1600 x 550, 1700 x 800, 1700 x 1200, 2000 x 1100', 'Modern beaded mirror', '', 'modern-beaded-mirror-750x600mm', 'Modern beaded detail mirror.'),
